create table <?= DB_SCHEMA ?>.geo_districtsdetail (
	_id int not null auto_increment comment 'Identificador',
	_district int not null comment 'Distrito',
	_economic decimal(4, 2) null comment 'Económica',
	_voterturnout decimal(4, 2) null comment 'Participación electoral',
	_health decimal(4, 2) null comment 'Salud',
	_education decimal(4, 2) null comment 'Educación',
	_security decimal(4, 2) null comment 'Seguridad',
	_population int null comment 'Población',
	_ids decimal(4, 2) not null comment 'IDS',
	_year Year not null comment 'Año',
	primary key (_id),
	unique key uk_districtsdetail_district_year (_district, _year),
	foreign key (_district) references <?= DB_SCHEMA ?>.geo_districts(_id)
)
engine = InnoDB
comment = 'Dimensiones IDS';


